import React, { useState } from 'react';
import MyHeader from './MyHeader.jsx';
import About from './About.jsx';
import Activities from './Activities.jsx';
import Team from './Team.jsx';
import ConuAI from './ConuAI.jsx';
import Home from './Home.jsx'; // Assuming you have a Home component

function App() {
    const [activeLink, setActiveLink] = useState('Home');

    const renderContent = () => {
        switch (activeLink) {
            case 'About':
                return <About />;
            case 'Activities':
                return <Activities />;
            case 'Team':
                return <Team />;
            case 'ConuAI':
                return <ConuAI />;
            default:
                return <Home />;
        }
    };

    return (
        <div>
            <MyHeader setActiveLink={setActiveLink} />
            <main>
                {renderContent()}
            </main>
        </div>
    );
}

export default App;
